import ReactDOM from 'react-dom';
ReactDOM.render(<h1>HELLO I AM ASHEESH</h1>,document.getElementById("root"));
ReactDOM.render(<h2>HELLO I AM AAYUSHI</h2>,document.getElementById("root"));
var ashu = document.createElement("h1");
ashu.innerHTML="HELLO I AM ASHEESH SHARMA";
document.getElementById("root").appendChild(ashu);
